import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Profile: React.FC = () => {
  const [userData, setUserData] = useState<any>(null); // Change 'any' to the actual type if you have one
  const navigate = useNavigate();

  useEffect(() => {
    const storedUserData = localStorage.getItem('userData');
    if (storedUserData) {
      setUserData(JSON.parse(storedUserData));
    } else {
      // Redirect to login if no user data
      navigate('/login');
    }
  }, [navigate]);

  if (!userData) {
    return <div>Loading...</div>; // Or some loading state
  }

  return (
    <div className="min-h-screen bg-gray-100 py-8 px-4">
      <div className="max-w-lg mx-auto bg-white p-6 rounded-lg shadow-lg">
        <h1 className="text-3xl font-semibold text-center text-gray-800 mb-6">Личный кабинет</h1>
        <p className="text-lg text-center text-gray-600">Добро пожаловать, {userData.name}!</p>
        <p className="text-lg text-center text-gray-600">Ваш email: {userData.email}</p>
        {/* Add more user information as needed */}
      </div>
    </div>
  );
};

export default Profile;
